import React from 'react';
import UsersView from './UserView';

const UsersContain = ({ users, setCurrentUser }) => (
  <ul>
    {users.map(user => (
      <UsersView user={user} onClick={() => setCurrentUser(user.id)} />
    ))}
  </ul>
);
export default UsersView;
